import styled from 'styled-components';

const App = () => {
  const Button = styled.button`
     {
      background-color: green;
      color: #fff;
      font-size: 16px;
      text-align: center;
      padding: 6px 30px;
    }
  `;

  const Para = styled.p`
    color: red;
    font-size: 16px;
  `;
  return (
    <>
      <Wrapper>
        <button className="btn">Subcribe Shyam</button>
        <p>Shyam Tahput</p>
      </Wrapper>
    </>
  );
};

export default App;
